contract Visibilidade{
    int contagem = 0;
  
  
    function  incremetal()public view returns(int){
      
      return contagem;

   }
   function incrementEx()external{
       contagem = contagem +1;
   }
function decrementaltEx()external{
       contagem = contagem -1;
   }
}

